import "./App.css";
import { Menu } from "./Menu/Menu";
import { Footer } from "./Footer/Footer";
import { useState } from "react";

enum Category {
  movie,
  cartoon,
  series,
}

type Card = {
  title: string;
  year: number;
  type: Category;
  image: string;
};

function App() {
  let [cards, setCards] = useState<Card[]>();

  return (
    <div className="App">
      <Menu
        items={Object.keys(Category).filter((item) => isNaN(Number(item)))}
        setCards={(cards: Card[]) => setCards(cards)}
      />
      <Footer />
    </div>
  );
}

export default App;
